import AwPanelSection from 'viewmodel/AwPanelSectionViewModel';

/**
 * render function
 *
 * @deprecated afx@4.2.0.
 * @alternative AwPanelSection
 * @obsoleteIn afx@5.1.0
 * @returns {JSX.Element} react component
 */
export const awCommandPanelSectionRenderFunction = ( props ) => {
    const {
        viewModel,
        ctxMin,
        actions,
        i18n,
        fields,
        grids,
        formProp,
        messages,
        ...prop
    } = props;
    prop.isCommandPanelSection = true;
    return <AwPanelSection {...prop}> {props.children} </AwPanelSection>;
};
